import { useEffect, useState } from "react"

const Home = () => {

    useEffect(async () => {
        const fetchWorkouts = async () => {
            const response = await fetch('/api/workouts')
        }

        fetchWorkouts()
    }, [])

    return (
      <div className="home">
        <h2>Home</h2>
      </div>
    )
  }
  
  export default Home
